import React from 'react'

import { Redirect } from 'react-router'

import Arrow002 from '../icons/arrows/Arrow002'

import './css/RoundedButton.scss'

const RoundedButton = (props) => {

    const handleSubmit = (event) => {
        alert("L'utilisateur a était soumis " + this.state.value);
        event.preventDefault();
        return (
        <Redirect
          to={{
            pathname: `/search_result`,
            state: {}
          }}
        />)
    }

    return (
        <>
            {/* <div
                id={props.button_div_ID}
            > */}
                <button
                    type='button'
                    id={props.button_ID}
                    className={props.button_CLASSNAME}
                    onClick={handleSubmit}
                >
                    <span className={props.span_text_CLASSNAME}>
                        {props.button_TEXT}
                    </span>
                        <Arrow002
                            display={props.Arrow002}
                        />
                </button>
            {/* </div> */}
        </>
    )
}

export default RoundedButton
